import React from 'react';
import headerStyles from '../Header/Header.module.scss'
import Header from '../Header/Header';
const Home = () => {

    return (
        <>
        <div className={headerStyles.logo}>
            <span>J. Merta</span>
        </div>
        <Header /></>
    );
}

export default Home;
